var background = scene.getObjectByName( 'Background' );
var torus = scene.getObjectByName( 'Torus' );

var group = new THREE.Group();
group.rotation.x = - 0.75;
scene.add( group );

group.add( background );
group.add( torus );


var object = scene.getObjectByName( 'Icosahedron' );
// scene.remove( object );

for ( var i = 0; i < 50; i ++ ) {

	var color = Math.random();

	var clone = object.clone();
	// clone.material = object.material.clone();
	// clone.material.color.setRGB( color, color, color );
	clone.position.set( Math.random() - 0.5, Math.random() - 0.5, Math.random() - 0.5 );
	clone.position.normalize();
	clone.position.multiplyScalar( Math.random() * 50 );
	clone.rotation.x = Math.random();
	clone.rotation.z = Math.random();
	clone.scale.multiplyScalar( Math.random() * Math.random() * 4 + 1 );
	group.add( clone );	

}

function update( event ) {

	var time = event.time * 0.0003;

	camera.position.x = Math.cos( time ) * 200;
	camera.position.z = Math.sin( time ) * 200;
	camera.lookAt( new THREE.Vector3() );

	group.rotation.y = time * 0.5;

}

