var cubeCamera = new THREE.CubeCamera( 1, 1000, 256 );
cubeCamera.renderTarget.texture.minFilter = THREE.LinearMipMapLinearFilter;
cubeCamera.renderTarget.texture.generateMipmaps = true;

//this.material.envMap = cubeCamera.renderTarget;

function handleTexture( map ) {

	map.magFilter = THREE.NearestFilter;
	map.wrapT = THREE.RepeatWrapping;
	map.repeat.y = 4;

}

// handleTexture( this.material.map );
// handleTexture( this.material.alphaMap );
//handleTexture( this.material.roughnessMap );
// handleTexture( this.material.metalnessMap );
var first = false;
var ldrCubeRenderTarget;
function update( event ) {
	if(!first){this.material.visible = false;

		cubeCamera.updateCubeMap( renderer, scene );

		cubeCamera.renderTarget.encoding = THREE.GammaEncoding;

		var pmremGenerator = new THREE.PMREMGenerator( cubeCamera.renderTarget );
		pmremGenerator.update( renderer );
		var pmremCubeUVPacker = new THREE.PMREMCubeUVPacker( pmremGenerator.cubeLods );
		pmremCubeUVPacker.update( renderer );
		ldrCubeRenderTarget = pmremCubeUVPacker.CubeUVRenderTarget;

		alert(ldrCubeRenderTarget.texture);
		this.material.visible = true;
		this.material.envMap  = ldrCubeRenderTarget.texture;
		//this.material.envMap = null;

		//this.material.needsUpdate = true;

		this.rotation.x = event.time * 0.0002;

		first = true;
	}
}
